import React from "react";
import Card from "./Card";
import image1 from "./images/novice.png";
import image2 from "./images/university.png";
import image3 from "./images/gamer.png";


const cards = [

    {id: 1,
     title: 'Novice',
     image: image1
    
    },

    {id: 2,
     title: 'University',
     image: image2
       
       },
       
       {id: 3,
        title: 'Gamer',
        image: image3
       
       },
]

function Cards() {
  return (
    <div className="container d-flex justify-content-center h-100 align-items-center   bg-info">
      <div className="row">
        <div className="col-md-4">
          <Card />
        </div>
      </div>
    </div>
  );
}

export default Cards;
